export default function BlogPost(props) {
  return (
    <div className="BlogPost">
      <h1>{props.title}</h1>
      <img src={props.imgPath}></img>
      <div className="text">
        {props.text.map(line => (
          <p>{line}</p>
        ))}
      </div>
      <style>{`
      .BlogPost {
        background: gray;
      }
      img {
        width: 90%;
        transform: translateX(-20px);
      }
  `}</style>
    </div>
  );
}
